--
-- V_TABLAS_COLUMNAS  (View)
--

CREATE OR REPLACE FORCE VIEW SINDICATO.V_TABLAS_COLUMNAS
(
   ID_TABLA,
   TABLA,
   COLUMNA,
   TIPO,
   PRECISION,
   ESCALA,
   TAMANO,
   REQUERIDO,
   COMENTARIO
)
AS
   SELECT u.COLUMN_ID,
          u.TABLE_NAME,
          U.COLUMN_NAME,
          U.DATA_TYPE,
          U.DATA_PRECISION,
          U.DATA_SCALE,
